//Contact page with links to my LinkedIn, Github, Twitter and emails
function Contact() {

    return (
        <div className="homeBackground">
            <h1 className="contact">Follow Me</h1>
            <p className="contactText">
                If you want to follow me click on one of the links 
            </p>
            <span className="button">
                <a href="https://www.youtube.com/@bjkd/videos"><i className="fa fa-brands fa-youtube"></i></a> 
            </span>

        </div>
    )
}

export default Contact;
